classDiagram
    class Universidad {
        - nombre: String
        - direccion: String
        + agregarFacultad(f: Facultad): void
    }

    class Facultad {
        - nombre: String
        + agregarPrograma(p: ProgramaAcademico): void
    }

    class ProgramaAcademico {
        - nombre: String
        - duracionSemestres: int
        + inscribirEstudiante(e: Estudiante): void
    }

    class Estudiante {
        - nombre: String
        - codigo: String
        - semestreActual: int
        + matricularCurso(c: Curso): Matricula
        + avanzarSemestre(): void
    }

    class Curso {
        - nombre: String
        - codigo: String
        - creditos: int
    }

    class Matricula {
        - periodo: String
        + agregarCalificacion(c: Curso, nota: float): void
    }

    class Calificacion {
        - nota: float
        - curso: Curso
    }

    class TrabajoDeGrado {
        - titulo: String
        - estado: String
        + presentar(): void
        + aprobar(): void
    }

    class Graduacion {
        - fecha: Date
        - modalidad: String
        + emitirDiploma(): void
    }

    %% Relaciones
    Universidad --> Facultad : contiene
    Facultad --> ProgramaAcademico : ofrece
    ProgramaAcademico --> Estudiante : inscribe
    Estudiante --> Matricula : tiene
    Matricula --> Curso : incluye
    Matricula --> Calificacion : registra
    Estudiante --> TrabajoDeGrado : realiza
    TrabajoDeGrado --> Graduacion : conduce a
